from typing import List

class Solution:
    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        # i + b = target
        # This dict keeps track of values that have already been tried.  This speeds things up and stops unecessary ops.
        lt = {}

        for i in range(0, len(numbers)):
            if numbers[i] not in lt:
                b = target - numbers[i]
                lt[i] = True

                # if b is in the nums list then we are good to go!
                if b in numbers[i+1:]:
                    return [i + 1, numbers.index(b, i+1) + 1]

